import './App.css';
import {HashRouter,Route,Routes,Link} from "react-router-dom";
import Main from './component/Main';
function App() {
  return (
    <HashRouter >

      <header>
        <h2>LOGO</h2>
      </header>
     <main>
        <Routes>

          <Route path="/" element={<Main />}></Route>


        </Routes>
      </main>
    </HashRouter>
  );
}

export default App;
